import React, { useState, useEffect } from 'react';
import { Bot, Send, TrendingUp, Users, Bed, Layout, Building2, ChevronDown } from 'lucide-react';
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, CartesianGrid, Cell } from 'recharts';

// נתוני דוגמה ל-3 נכסים עבור הפיילוט
const propertyData = {
  all: [
    { name: 'וילה קיסריה', tasks: 45, color: '#3b82f6' },
    { name: 'ת"א פנטהאוז', tasks: 32, color: '#8b5cf6' },
    { name: 'ירושלים סוויטה', tasks: 28, color: '#ec4899' }
  ],
  caesarea: [
    { name: 'דני (ניקיון)', tasks: 12 },
    { name: 'מיכל (תחזוקה)', tasks: 8 },
    { name: 'יוסי (צק-אין)', tasks: 15 }
  ]
};

function App() {
  const [selectedProperty, setSelectedProperty] = useState('all');
  const [userInput, setUserInput] = useState("");
  const [aiResponse, setAiResponse] = useState("שלום. אני סורק את נתוני 3 הנכסים שלך. איזה ניתוח תרצה שאבצע?");
  
  const askAI = async () => {
    if (!userInput) return;
    setAiResponse(`מנתח ביצועים עבור ${selectedProperty === 'all' ? 'כל הפורטפוליו' : 'הנכס הנבחר'}...`);
    // כאן ה-AI יתחבר ל-app.py שלך
  };

  return (
    <div style={{ padding: '0', margin: '0', fontFamily: 'Inter, sans-serif', direction: 'rtl', backgroundColor: '#020617', color: '#f8fafc', minHeight: '100vh', display: 'flex' }}>
      
      {/* Sidebar */}
      <div style={{ width: '80px', backgroundColor: '#0f172a', borderLeft: '1px solid #1e293b', display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px 0', gap: '30px' }}>
        <div style={{ background: 'linear-gradient(135deg, #3b82f6 0%, #2563eb 100%)', padding: '12px', borderRadius: '16px' }}><Building2 color="white" /></div>
      </div>

      <div style={{ flex: 1, padding: '40px' }}>
        {/* Top Bar with Property Selector */}
        <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '40px' }}>
          <div>
            <h1 style={{ fontSize: '28px', fontWeight: '800', margin: '0' }}>ניהול פורטפוליו <span style={{ color: '#3b82f6' }}>LuxuryStay</span></h1>
            <p style={{ color: '#64748b' }}>פיילוט פעיל: 3 נכסים בניהול</p>
          </div>
          
          <select 
            value={selectedProperty}
            onChange={(e) => setSelectedProperty(e.target.value)}
            style={{ background: '#1e293b', color: '#fff', border: '1px solid #334155', padding: '12px 25px', borderRadius: '12px', fontSize: '16px', outline: 'none', cursor: 'pointer' }}
          >
            <option value="all">כל הנכסים</option>
            <option value="caesarea">וילה קיסריה</option>
            <option value="tlv">ת"א פנטהאוז</option>
            <option value="jerusalem">ירושלים סוויטה</option>
          </select>
        </header>

        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1.5fr', gap: '30px' }}>
          
          {/* AI Side */}
          <div style={{ background: '#0f172a', padding: '30px', borderRadius: '32px', border: '1px solid #1e293b' }}>
            <h3 style={{ display: 'flex', alignItems: 'center', gap: '10px' }}><Bot color="#3b82f6" /> ייעוץ AI לנכס</h3>
            <div style={{ height: '300px', background: '#020617', padding: '20px', borderRadius: '20px', marginBottom: '20px', color: '#cbd5e1', borderRight: '4px solid #3b82f6' }}>
              {aiResponse}
            </div>
            <div style={{ display: 'flex', gap: '10px' }}>
              <input 
                value={userInput}
                onChange={(e) => setUserInput(e.target.value)}
                placeholder="שאל על רווחיות או ביצועי סוכנים..."
                style={{ flex: 1, background: '#1e293b', border: 'none', color: '#fff', padding: '15px', borderRadius: '15px' }}
              />
              <button onClick={askAI} style={{ background: '#3b82f6', color: '#fff', border: 'none', padding: '0 20px', borderRadius: '15px', cursor: 'pointer' }}>שלח</button>
            </div>
          </div>

          {/* Graph Side */}
          <div style={{ background: '#0f172a', padding: '30px', borderRadius: '32px', border: '1px solid #1e293b' }}>
            <h3 style={{ marginBottom: '25px' }}>{selectedProperty === 'all' ? 'התפלגות משימות לפי נכס' : 'ביצועי צוות בנכס'}</h3>
            <div style={{ height: '350px' }}>
              <ResponsiveContainer width="100%" height="100%">
                <BarChart data={selectedProperty === 'all' ? propertyData.all : propertyData.caesarea}>
                  <XAxis dataKey="name" stroke="#64748b" />
                  <YAxis stroke="#64748b" />
                  <Tooltip contentStyle={{ background: '#0f172a', border: 'none' }} />
                  <Bar dataKey="tasks" radius={[8, 8, 0, 0]} barSize={50}>
                    { (selectedProperty === 'all' ? propertyData.all : propertyData.caesarea).map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={entry.color || '#3b82f6'} />
                    ))}
                  </Bar>
                </BarChart>
              </ResponsiveContainer>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
